import React from 'react';
import './carousel.css';

class Carousel extends React.Component{
  render(){
    return(
      <div>
        {CarouselDate.map((item,index) => {
          <ul key={index} className="carousel-indicators ">
          <li data-target="#demo" data-slide-to="0"></li>
          </ul>
        })}



      </div>
    )
  }
}
export default Carousel
